import React, { useEffect } from 'react';
import { List, Badge, Collapse } from 'antd';

const data = [
    {
        req: 1,
        title: "누상동 다목적 운동장",
        description: "인도어풋살장",
        content: "우레탄이 아닌 풋살장입니다"
    },
    {
        req: 2,
        title: "누상동 다목적 운동장",
        description: "인도어풋살장",
        content: "우레탄이 아닌 풋살장입니다"
    },
    {
        req: 3,
        title: "누상동 다목적 운동장",
        description: "인도어풋살장",
        content: "우레탄이 아닌 풋살장입니다"
    },
    {
        req: 4,
        title: "누상동 다목적 운동장",
        description: "인도어풋살장",
        content: "우레탄이 아닌 풋살장입니다"
    }
];
const StadiumList = () => {
    return (
        <List
            header={<div style={{ fontSize: 20, fontWeight: "bold", paddingLeft: '16px' }}>구장 리스트</div>}
            style={{ height: '70vh' }}
            size="small"
            itemLayout="vertical"
            pagination={{
                onChange: page => {
                    console.log(page);
                },
                showLessItems: true,
            }}
            dataSource={data}
            renderItem={item => (
                <List.Item
                    key={item.req}
                    style={{ textOverflow: "ellipsis", overflow: "hidden", whiteSpace: "nowrap" }}
                >
                    <List.Item.Meta
                        title={item.title}
                        description={item.description}
                        style={{ textOverflow: "ellipsis", overflow: "hidden", whiteSpace: "nowrap" }}
                    />
                    {item.content}
                </List.Item >
            )}
        >

        </List >
    )
}

export default StadiumList;
